window.bookSummaryJSON = "<p>Just when I thought this quest couldn’t end soon enough, yet another surprise sends us sprinting further north in a desperate search for a cure.</p> <p>We’re running out of time, and the life of my mate—let alone the entire world—rests in the balance.</p> <p>Because now we know the legacy isn’t just about the clan Queen. An ancient evil has been growing in hidden places, aided by the Elders and their bitter determination to keep secrets.</p> <p>As darkness closes in, our last ray of hope is to fulfill the legacy of the Queen and end the wraiths for all time.</p> <p>Or fail, and doom the world to eternal night.</p> <p><i>Legacy Fulfilled </i>is the fourth and final book in The Warrior Queen Legacy, featuring a badass heroine, a dark fantasy world, and loads of sexy wolf shifters. </p> <p>Be warned: This is a slow burn romance in which the main character keeps all of her men. Once you pick this story up, you won’t be able to stop devouring it until the very end.</p> <p>The Warrior Queen Legacy is now complete!</p>"; 
